import React, { useEffect, useState } from 'react';
import { Typography, Box, Card, CardContent, Grid, Button, Stack } from '@mui/material';
import { People as CommunityIcon } from '@mui/icons-material';
import { communityService } from '../services/communityService';

const CommunityPage = () => {
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);
  const [challenges, setChallenges] = useState([]);
  const [leaderboard, setLeaderboard] = useState([]);

  useEffect(() => {
    const loadData = async () => {
      setLoading(true);
      setError(null);
      try {
        const [challengesRes, leaderboardRes] = await Promise.all([
          communityService.listChallenges().catch(() => null),
          communityService.leaderboard().catch(() => null)
        ]);

        // Normalize results; backend currently returns placeholder messages
        const normalizedChallenges = Array.isArray(challengesRes?.items)
          ? challengesRes.items
          : [];
        const normalizedLeaderboard = Array.isArray(leaderboardRes?.items)
          ? leaderboardRes.items
          : [];

        setChallenges(normalizedChallenges);
        setLeaderboard(normalizedLeaderboard);
      } catch (e) {
        setError('Failed to load community data');
      } finally {
        setLoading(false);
      }
    };

    loadData();
  }, []);

  const handleJoin = async (id) => {
    try {
      await communityService.joinChallenge(id);
      // Optional: refresh leaderboard/challenges after join
    } catch (e) {
      // Silently ignore for now; can surface a toast/snackbar later
    }
  };

  return (
    <Box>
      <Typography variant="h4" gutterBottom>
        <CommunityIcon sx={{ mr: 1, verticalAlign: 'middle' }} />
        Community & Challenges
      </Typography>
      <Typography variant="body1" color="text.secondary" gutterBottom>
        Join fitness challenges, connect with others, and stay motivated together
      </Typography>

      <Grid container spacing={3} sx={{ mt: 2 }}>
        <Grid item xs={12} md={7}>
          <Card className="card">
            <CardContent>
              <Typography variant="h6" gutterBottom>
                Challenges
              </Typography>
              {loading ? (
                <Typography variant="body2" color="text.secondary">Loading…</Typography>
              ) : error ? (
                <Typography variant="body2" color="error">{error}</Typography>
              ) : challenges.length === 0 ? (
                <Typography variant="body2" color="text.secondary">
                  No challenges yet. Stay tuned!
                </Typography>
              ) : (
                <Stack spacing={1}>
                  {challenges.map((c) => (
                    <Box key={c.id} display="flex" alignItems="center" justifyContent="space-between">
                      <Box>
                        <Typography variant="subtitle1">{c.title}</Typography>
                        <Typography variant="caption" color="text.secondary">{c.description}</Typography>
                      </Box>
                      <Button size="small" variant="contained" onClick={() => handleJoin(c.id)}>Join</Button>
                    </Box>
                  ))}
                </Stack>
              )}
            </CardContent>
          </Card>
        </Grid>

        <Grid item xs={12} md={5}>
          <Card className="card">
            <CardContent>
              <Typography variant="h6" gutterBottom>
                Leaderboard
              </Typography>
              {loading ? (
                <Typography variant="body2" color="text.secondary">Loading…</Typography>
              ) : error ? (
                <Typography variant="body2" color="error">{error}</Typography>
              ) : leaderboard.length === 0 ? (
                <Typography variant="body2" color="text.secondary">
                  No leaderboard data yet.
                </Typography>
              ) : (
                <Stack spacing={1}>
                  {leaderboard.map((u, idx) => (
                    <Box key={u.id} display="flex" alignItems="center" justifyContent="space-between">
                      <Typography variant="body2">#{idx + 1} {u.name}</Typography>
                      <Typography variant="body2" color="text.secondary">{u.points} pts</Typography>
                    </Box>
                  ))}
                </Stack>
              )}
            </CardContent>
          </Card>
        </Grid>

        <Grid item xs={12}>
          <Card className="card">
            <CardContent>
              <Typography variant="h6" gutterBottom>
                Community Module Coming Soon
              </Typography>
              <Typography variant="body2" color="text.secondary">
                This module will include:
              </Typography>
              <ul>
                <li>Users can join fitness challenges (e.g., "30-Day Yoga Challenge")</li>
                <li>Leaderboard to display active users</li>
                <li>Comment section for motivation & tips</li>
                <li>Community forums and discussions</li>
                <li>Social features and friend connections</li>
              </ul>
            </CardContent>
          </Card>
        </Grid>
      </Grid>
    </Box>
  );
};

export default CommunityPage;
